INSERT INTO `faqs` (`id`, `language_id`, `question`, `answer`, `serial_number`, `created_at`, `updated_at`) VALUES
(16, 20, 'How do I list my car on your website?', 'To list your car, simply create an account on our website, provide accurate vehicle information, upload high-quality photos, and set an appropriate price.', 1, '2023-08-19 02:29:36', '2023-08-19 02:29:36'),
(17, 20, 'Can I list multiple cars under one account?', 'Yes, you can list multiple cars using a single account. Just follow the same listing process for each vehicle.', 2, '2023-08-19 02:29:51', '2023-08-19 02:29:51'),
(18, 20, 'Is there a fee for listing my car on your platform?', 'We offer both free and premium listing options. Basic listings are free, while premium options may include enhanced visibility and additional features for a fee.', 3, '2023-08-19 02:30:06', '2023-08-19 02:30:06'),
(19, 20, 'What type of information should I include in my car listing?', 'It\'s important to provide detailed information such as the make, model, year, mileage, condition, features, and any history of accidents or repairs. The more details you provide, the better your chances of attracting potential buyers.', 4, '2023-08-19 02:30:22', '2023-08-19 02:30:22'),
(20, 20, 'How long will my car listing be active?', 'The duration of your car listing depends on the type of listing you choose. Free listings usually have a standard duration, while premium listings may have extended visibility periods.', 5, '2023-08-19 02:30:37', '2023-08-19 02:30:37'),
(21, 20, 'Can I edit my listing after it\'s live?', 'Yes, you can edit your listing at any time. Log in to your account, access your listing, and make the necessary changes to the details, price, or images.', 6, '2023-08-19 02:30:55', '2023-08-19 02:30:55'),
(22, 20, 'How do I communicate with potential buyers?', 'Interested buyers can contact you through the contact information you provide in your listing. We recommend using our secure messaging system to maintain privacy and security during negotiations.', 7, '2023-08-19 02:31:11', '2023-08-19 02:31:11'),
(23, 20, 'What happens if my car sells through another platform?', 'If your car sells through another platform, it\'s important to promptly remove or mark your listing as sold on our website to avoid any confusion for potential buyers.', 8, '2023-08-19 02:31:29', '2023-08-19 02:31:29'),
(24, 20, 'Are there any tips for taking appealing car photos?', 'Absolutely! Clear, well-lit photos taken from various angles can significantly enhance your listing. Include shots of the interior, exterior, engine, and any special features.', 9, '2023-08-19 02:31:45', '2023-08-19 02:31:45'),
(25, 20, 'What safety measures are in place to prevent fraud?', 'We take fraud prevention seriously. We use various security measures and recommend dealing locally, verifying buyer information, and being cautious of unusual payment requests.', 10, '2023-08-19 02:32:01', '2023-08-28 03:18:16'),
(26, 21, 'كيف أقوم بإدراج سيارتي في موقع الويب الخاص بك؟', 'لإدراج سيارتك ، ما عليك سوى إنشاء حساب على موقعنا الإلكتروني ، وتقديم معلومات دقيقة عن السيارة ، وتحميل صور عالية الجودة ، وتحديد السعر المناسب.', 1, '2023-08-19 02:32:32', '2023-08-19 02:32:32'),
(27, 21, 'هل يمكنني إدراج عدة سيارات في حساب واحد؟', 'نعم ، يمكنك إدراج عدة سيارات باستخدام حساب واحد. ما عليك سوى اتباع نفس عملية الإدراج لكل مركبة.', 2, '2023-08-19 02:32:57', '2023-08-19 02:32:57'),
(28, 21, 'هل هناك رسوم لإدراج سيارتي على منصتك؟', 'نحن نقدم كلاً من خيارات الإدراج المجانية والمتميزة. القوائم الأساسية مجانية ، بينما قد تتضمن الخيارات المتميزة رؤية محسنة وميزات إضافية مقابل رسوم.', 3, '2023-08-19 02:33:20', '2023-08-19 02:33:20'),
(29, 21, 'ما نوع المعلومات التي يجب أن أدرجها في قائمة سيارتي؟', 'من المهم تقديم معلومات مفصلة مثل الطراز والطراز والسنة والمسافة المقطوعة والحالة والميزات وأي سجل للحوادث أو الإصلاحات. كلما زادت التفاصيل التي تقدمها ، زادت فرصك في جذب المشترين المحتملين.', 4, '2023-08-19 02:33:43', '2023-08-19 02:33:43'),
(30, 21, 'كم من الوقت ستكون قائمة سيارتي نشطة؟', 'تعتمد مدة قائمة سيارتك على نوع القائمة التي تختارها. عادةً ما يكون للقوائم المجانية مدة قياسية ، في حين أن القوائم المميزة قد تحتوي على فترات رؤية ممتدة.', 5, '2023-08-19 02:34:08', '2023-08-19 02:34:08'),
(31, 21, 'هل يمكنني تعديل القائمة الخاصة بي بعد أن تكون مباشرة؟', 'نعم ، يمكنك تعديل قائمتك في أي وقت. قم بتسجيل الدخول إلى حسابك ، والوصول إلى قائمتك ، وإجراء التغييرات اللازمة على التفاصيل أو السعر أو الصور.', 6, '2023-08-19 02:34:32', '2023-08-19 02:34:32'),
(32, 21, 'كيف أتواصل مع المشترين المحتملين؟', 'يمكن للمشترين المهتمين الاتصال بك من خلال معلومات الاتصال التي تقدمها في قائمتك. نوصي باستخدام نظام المراسلة الآمن الخاص بنا للحفاظ على الخصوصية والأمان أثناء المفاوضات.', 7, '2023-08-19 02:35:10', '2023-08-19 02:35:10'),
(33, 21, 'ماذا يحدث إذا تم بيع سيارتي من خلال منصة أخرى؟', 'إذا كانت سيارتك تبيع من خلال منصة أخرى ، فمن المهم إزالة أو وضع علامة على قائمتك على الفور على أنها مباعة على موقعنا على الإنترنت لتجنب أي ارتباك للمشترين المحتملين.', 8, '2023-08-19 02:35:46', '2023-08-19 02:35:46'),
(34, 21, 'هل هناك أي نصائح لالتقاط صور جذابة للسيارة؟', 'قطعاً! يمكن للصور الواضحة والمضاءة جيدًا التي تم التقاطها من زوايا مختلفة أن تعزز إدراجك بشكل كبير. قم بتضمين لقطات من الداخل والخارج والمحرك وأي ميزات خاصة.', 9, '2023-08-19 02:36:10', '2023-08-19 02:36:10'),
(35, 21, 'ما هي تدابير السلامة المعمول بها لمنع الاحتيال؟', 'نحن نتعامل مع منع الاحتيال على محمل الجد. نحن نستخدم تدابير أمنية مختلفة ونوصي بالتعامل محليًا ، والتحقق من معلومات المشتري ، والحذر من طلبات الدفع غير العادية.', 10, '2023-08-19 02:36:34', '2023-08-19 02:36:34');

