INSERT INTO `testimonials` (`id`, `language_id`, `image`, `name`, `occupation`, `comment`, `rating`, `created_at`, `updated_at`) VALUES
(25, 20, '64e090a46f9b5.png', 'Hames Rodrigo', 'Marketing Executive', 'I had an amazing experience using this car listing website. The user-friendly interface made it so easy for me to find the perfect car that suited my needs. The variety of options available was impressive, and I\'m thrilled with the smooth purchasing process. Highly recommended!', '5', '2023-08-19 03:51:32', '2023-08-19 03:51:32'),
(26, 20, '64e090d7f3613.png', 'John Martinez', 'IT Consultant', 'As someone who values efficiency, I appreciated how organized and informative this car listing website is. The search filters helped me narrow down my options quickly. The only reason I\'m not giving it a perfect score is that I wish there were more detailed photos for some of the listings', '4.5', '2023-08-19 03:52:23', '2023-08-19 03:52:55'),
(27, 20, '64e09132e765f.png', 'Emily Parker', 'Teacher', 'I\'m usually quite skeptical about online purchases, but this car listing website exceeded my expectations. The transparency in providing vehicle histories and the thorough descriptions gave me confidence in my choices. Thanks to this platform, I found a reliable car that perfectly fits my budget', '5', '2023-08-19 03:53:54', '2023-08-19 03:53:54'),
(28, 20, '64e091760ae84.png', 'Michael Collins', 'Marketing Manager', '\"I had been dreading the process of searching for a new car, but this website made it surprisingly enjoyable. The intuitive layout made navigation a breeze, and the real-time chat support was incredibly helpful when I had questions. My new car is everything I hoped for, and I\'m thankful for this platform', '4.3', '2023-08-19 03:55:02', '2023-08-19 03:55:02'),
(29, 20, '64e091afd6994.png', 'Jennifer Lee', 'Freelance Photographer', 'I found the car listing website to be quite useful overall. It helped me find some interesting options for my next vehicle. However, I did encounter a few technical glitches during the search, which slightly affected my experience. With a bit more polish, this could easily become my go-to platform for car shopping.', '5', '2023-08-19 03:55:59', '2023-08-19 03:55:59'),
(30, 21, '64e09def8014f.png', 'هاميس رودريجو', 'تنفيذي تسويق', 'لقد حظيت بتجربة مدهشة باستخدام موقع قائمة السيارات هذا. جعلت الواجهة سهلة الاستخدام من السهل جدًا علي العثور على السيارة المثالية التي تناسب احتياجاتي. كان تنوع الخيارات المتاحة مثيرًا للإعجاب ، وأنا سعيد بعملية الشراء السلسة. ينصح به بشده!', '5', '2023-08-19 04:48:15', '2023-08-19 04:48:15'),
(32, 21, '64e09e66b5c5e.png', 'جون مارتينيز', 'مستشار تكنولوجيا المعلومات', 'As someone who values efficiency, I appreciated how organized and informative this car listing website is. The search filters helped me narrow down my options quickly. The only reason I\'m not giving it a perfect score is that I wish there were more detailed photos for some of the listings', '4.5', '2023-08-19 04:50:14', '2023-08-19 04:50:14'),
(33, 21, '64e09e93ace14.png', 'إميلي باركر', 'مدرس', 'عادةً ما أكون متشككًا جدًا بشأن عمليات الشراء عبر الإنترنت ، لكن موقع قائمة السيارات هذا تجاوز توقعاتي. أعطتني الشفافية في تقديم تاريخ المركبات والأوصاف الدقيقة الثقة في اختياراتي. بفضل هذه المنصة ، وجدت سيارة موثوقة تناسب ميزانيتي تمامًا', '5', '2023-08-19 04:50:59', '2023-08-19 04:50:59'),
(34, 21, '64e09eb9487cc.png', 'مايكل كولينز', 'مدير تسويق', '\"كنت أخشى عملية البحث عن سيارة جديدة ، لكن موقع الويب هذا جعلها ممتعة بشكل مدهش. جعل التصميم البديهي التنقل نسيمًا ، وكان دعم الدردشة في الوقت الفعلي مفيدًا بشكل لا يصدق عندما كانت لدي أسئلة. سيارتي الجديدة هي كل شيء كنت أتمنى ، وأنا ممتن لهذه المنصة', '4.3', '2023-08-19 04:51:37', '2023-08-19 04:51:37'),
(35, 21, '64e09ee9cfb9f.png', 'جينيفر لي', 'مصور فوتوغرافي مستقل', 'لقد وجدت أن موقع قائمة السيارات مفيد جدًا بشكل عام. لقد ساعدني في العثور على بعض الخيارات المثيرة للاهتمام لسيارتي القادمة. ومع ذلك ، واجهت بعض الأخطاء الفنية أثناء البحث ، مما أثر قليلاً على تجربتي. مع مزيد من الصقل قليلاً ، يمكن أن يصبح هذا بسهولة منصة الذهاب إلى التسوق في السيارات.', '5', '2023-08-19 04:52:25', '2023-08-19 04:52:25');

