INSERT INTO `vendor_infos` (`id`, `vendor_id`, `language_id`, `name`, `country`, `city`, `state`, `zip_code`, `address`, `details`, `created_at`, `updated_at`) VALUES
(21, 14, 21, 'إيزابيلا مارتينيز', 'المملكة المتحدة', 'لندن', 'إنكلترا', 'SW1A 1AA', '567 بارك لين, المملكة المتحدة', 'تدير إيزابيلا وكالة لبيع السيارات الرياضية والفاخرة. تضمن شبكتها الواسعة في صناعة السيارات أن لديها دائمًا أحدث الموديلات والإصدارات المحدودة المتاحة لعملائها المميزين.', '2023-08-17 04:35:14', '2023-08-21 02:22:31'),
(22, 13, 20, 'Sarah Johnson', 'United States', 'Los Angeles', 'California', '90001', '1234 Oak Street, United States', 'Enthusiastic about luxury cars and vintage models. Has been in the automotive industry for over a decade.', '2023-08-21 02:11:16', '2023-08-21 02:16:09'),
(23, 13, 21, 'سارة جونسون', 'الولايات المتحدة', 'لوس أنجلوس', 'كاليفورنيا', '90001', '1234 شارع أوك', 'متحمس للسيارات الفاخرة والموديلات القديمة. يعمل في صناعة السيارات منذ أكثر من عقد.', '2023-08-21 02:11:16', '2023-08-21 02:11:16'),
(24, 14, 20, 'Isabella Martinez', 'United Kingdom', 'London', 'England', 'SW1A 1AA', '567 Park Lane, United Kingdom', 'Isabella runs a high-end sports and luxury car dealership. Her extensive network in the automotive industry ensures that she always has the latest models and limited editions available for her discerning clientele.', '2023-08-21 02:22:31', '2023-08-21 02:22:31'),
(25, 15, 20, 'Lars Schmidt', 'Germany', 'Berlin', NULL, '10115', '789 Greenway Strasse, Germany', 'Lars is a pioneer in eco-friendly vehicles. He specializes in electric and hybrid cars, promoting sustainable transportation options for a greener future. His showroom showcases the latest advancements in green technology.', '2023-08-21 02:25:03', '2023-08-21 02:25:03'),
(26, 15, 21, 'لارس شميت', 'ألمانيا', 'برلين', NULL, '10115', '789 غرينواي شتراسه, ألمانيا', 'لارس هي شركة رائدة في مجال السيارات الصديقة للبيئة. إنه متخصص في السيارات الكهربائية والهجينة ، ويعزز خيارات النقل المستدامة من أجل مستقبل أكثر خضرة. تعرض صالة العرض الخاصة به أحدث التطورات في التكنولوجيا الخضراء.', '2023-08-21 02:25:03', '2023-08-21 02:25:03'),
(27, 16, 20, 'Emily Chen', 'Australia', 'Sydney', NULL, '2000', '101 Beachfront Avenue, Australia', 'Emily\'s focus is on family-oriented vehicles. She understands the needs of parents and offers a wide range of SUVs, minivans, and reliable cars that prioritize safety and comfort for family trips.', '2023-08-21 02:29:32', '2023-08-21 02:29:32'),
(28, 16, 21, 'إميلي تشين', 'أستراليا', 'سيدني', NULL, '2000', '101 شارع بيتشفرونت ، أستراليا', 'ينصب تركيز إميلي على المركبات الموجهة نحو الأسرة. إنها تتفهم احتياجات الوالدين وتقدم مجموعة واسعة من سيارات الدفع الرباعي والشاحنات الصغيرة والسيارات الموثوقة التي تعطي الأولوية للسلامة والراحة للرحلات العائلية.', '2023-08-21 02:29:32', '2023-08-21 02:29:32'),
(29, 17, 20, 'Jackson Stone', 'United States', 'Denver', NULL, '80202', '456 Rocky Trail, United State', 'Jackson specializes in off-road and adventure vehicles. His selection includes trucks, SUVs, and modified vehicles that are perfect for exploring challenging terrains and embarking on outdoor escapades.', '2023-08-21 02:32:06', '2023-08-21 02:32:06'),
(30, 17, 21, 'جاكسون ستون', 'الولايات المتحدة', 'دنفر', NULL, '80202', '456 روكي تريل ، الولايات المتحدة', 'جاكسون متخصص في المركبات على الطرق الوعرة والمغامرة. يشمل اختياره الشاحنات وسيارات الدفع الرباعي والمركبات المعدلة المثالية لاستكشاف التضاريس الصعبة والشروع في مغامرات في الهواء الطلق.', '2023-08-21 02:32:06', '2023-08-21 02:32:06'),
(31, 18, 20, 'Marie Leclerc', 'France', 'Paris', NULL, '75001', '23 Rue de l\'Automobile, France', 'Marie caters to the urban dweller, focusing on compact cars and city-friendly vehicles. Her showroom showcases stylish and efficient cars that are well-suited for navigating the bustling streets of the city.', '2023-08-21 02:33:44', '2023-08-21 02:33:44'),
(32, 18, 21, 'ماري لوكلير', 'فرنسا', 'باريس', NULL, '75001', '23 شارع دي لو أوتوموبيل ، فرنسا', 'تقدم ماري خدماتها لسكان المدن ، وتركز على السيارات المدمجة والمركبات الصديقة للمدينة. تعرض صالة عرضها سيارات أنيقة وفعالة ومناسبة تمامًا للتنقل في شوارع المدينة الصاخبة.', '2023-08-21 02:33:44', '2023-08-21 02:33:44'),
(33, 19, 20, 'Marco Rossi', 'Italy', 'Milan', NULL, '20121', 'Via delle Auto d\'Epoca 10, Italy', 'Marco is a connoisseur of classic European cars. He sources and restores vintage automobiles, focusing on preserving their original charm and elegance. His collection showcases the craftsmanship of a bygone era.', '2023-08-21 02:37:13', '2023-08-21 02:44:57'),
(34, 19, 21, 'ماركو روسي', 'إيطاليا', 'ميلان', NULL, '20121', 'فيا ديلي أوتو ديبوكا، 10، إيطاليا', 'ماركو هو متذوق السيارات الأوروبية الكلاسيكية. يقوم بتزويد واستعادة السيارات القديمة ، مع التركيز على الحفاظ على سحرها الأصلي وأناقتها. تعرض مجموعته حرفية حقبة ماضية.', '2023-08-21 02:37:13', '2023-08-21 02:37:13'),
(35, 20, 20, 'Yuki Tanaka', 'Japan', 'Tokyo', NULL, '100-0005', '789 Sakura Street, Japan', 'Yuki specializes in affordable and reliable vehicles for everyday commuting. Her selection includes compact cars and economy models that cater to individuals looking for practical transportation options without breaking the bank.', '2023-08-21 02:38:45', '2023-08-21 02:38:45'),
(36, 20, 21, 'يوكي تاناكا', 'اليابان', 'طوكيو', NULL, '100-0005', '789 شارع ساكورا ، اليابان', 'شركة Yuki متخصصة في السيارات ذات الأسعار المعقولة والموثوقة للتنقل اليومي. يشمل اختيارها السيارات المدمجة والنماذج الاقتصادية التي تلبي احتياجات الأفراد الذين يبحثون عن خيارات النقل العملية دون كسر البنك.', '2023-08-21 02:38:45', '2023-08-21 02:38:45');

